if mibBuilder.loadTexts: hwCdpComplianceRemoteTable.setDescription('This table contains one or more rows per physical network connection known to this agent. The agent may wish to ensure that only one hwCdpComplianceRemoteEntry is present for each local port, or it may choose to maintain multiple hwCdpComplianceRemoteEntry for the same local port. The following procedure may be used to retrieve remote systems information updates from an CDP compliance agent: 1. NMS polls all tables associated with remote systems and keeps a local copy of the information retrieved. 2. CDP compliance agent updates remote systems MIB objects, and sends out notifications to a list of notification destinations. 3. NMS receives the notifications and compares the new values of objects listed in step 1. Periodically, NMS should poll the object hwCdpStatsRemTablesLastChangeTime to find out if anything has changed since the last poll. if something has changed, NMS will poll the objects listed in step 1 to figure out what kind of changes occurred in the tables. if value of hwCdpComplianceStatsRemTablesInserts has changed, then NMS will walk all tables by employing TimeFilter with the last-polled time value. This request will return new objects or objects whose values are updated since the last poll. if value of hwCdpComplianceStatsRemTablesAgeouts has changed, then NMS will walk the hwCdpComplianceStatsRxPortAgeoutsTotal and compare the new values with previously recorded ones. For ports whose hwCdpComplianceStatsRxPortAgeoutsTotal value is greater than the recorded value, NMS will have to retrieve objects associated with those ports from table(s) without employing a TimeFilter (which is performed by specifying 0 for the TimeFilter.) hwCdpComplianceStatsRemTablesDeletes and hwCdpComplianceStatsRemTablesDrops objects are provided for informational purposes.')
